import Container from "../components/Container";
import Row from ".."
const Ride = () => (
    <Container style={{ marginTop: 30 }}>
        <Row>
            <Col size="md-12">

                <h1>Welcome To MedCabinet!</h1>
            </Col>
        </Row>
    </Container>
);

export default Ride;
